import styled from "styled-components"

export const ContainerHeader = styled.div`
position: fixed;
z-index: 999;
top: 0;
left: 0;
right: 0;
height: 30px;
padding: 15px;
background-color: black;
width: auto;

img {

    width: 100px;
}

`
